import React from 'react';
import { StyleSheet, Text, View } from 'react-native';

const Umesh=()=>{
  return ( <Text>welcome umesh</Text> );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});

export default Umesh;
